import React from 'react'
import kimetsu from './kimetsu.png'

export default function Header() {
  return (
    <div className="bg-local from-purple-600 to-blue-600">
      <img src={kimetsu} alt="kimetsu no yaiba" className=""/>
    </div>
  )
}
